import React from 'react';
import { Link } from 'react-router-dom';
import fawryImage from '../images/fawry-icon.png'; // Image for Fawry
import digitalWalletImage from '../images/digital-wallet-icon.png'; // Image for Digital Wallet
import creditCardImage from '../images/credit-card-icon.png'; // Image for Credit Card

const PaymentMethodSelection = () => {
  return (
    <div className="payment-method-selection">
      <h2>Select Payment Method</h2>

      {/* Fawry Payment Method */}
      <div className="payment-method">
        <img src={fawryImage} alt="Fawry" className="payment-method-image" />
        <Link to="/fawry" className="payment-method-button">
          Fawry Payment
        </Link>
      </div>

      {/* Digital Wallet Payment Method */}
      <div className="payment-method">
        <img
          src={digitalWalletImage}
          alt="Digital Wallet"
          className="payment-method-image"
        />
        <Link to="/digital-wallet" className="payment-method-button">
          Digital Wallet Payment
        </Link>
      </div>

      {/* Credit Card Payment Method */}
      <div className="payment-method">
        <img src={creditCardImage} alt="Credit Card" className="payment-method-image" />
        <Link to="/credit-card" className="payment-method-button">
          Credit Card Payment
        </Link>
      </div>
    </div>
  );
};

export default PaymentMethodSelection;
